import React from 'react';
import './topnav.css';

class TopNav extends React.Component {
  render() {
    return (
      <div className="top-nav d-flex justify-content-end col-sm-10">
        <nav className="navbar sticky-top">
            <p>newUpdate</p>
            <img></img>
        </nav>
      </div>
    );
  }
}

export default TopNav;
